import React, {Component} from 'react';

class Header extends Component {
  constructor(props) {
    super(props)
    this.state = {
      ctr: 0
    }
  }

  render() {
    return (
      <div className='Header'>
      <div className='Text'>
      <h2 id='Home'>Marshmallow Poker</h2>
      <p className='Value'>{this.state.ctr} Pokes</p>
      </div>
      </div>
    )
  }
}

export default Header
